import React from 'react';
import Container from '@material-ui/core/Container';
import { makeStyles } from '@material-ui/core';

const Card = (props) => {
    return (
        <Container maxWidth="sm">
            <img src={props.url} height="150" width="150"/>
        </Container>
    );
};

export default Card;
